import React from "react";

function Profile(props) {
    return (
        <section className="profile">
            <h2 className="profile__name">Привет, {props.name}!</h2>
            <form className="profile__form">
                <div className="profile__item">
                    <label className="profile__item-name">Имя</label>
                    <input className="input__name" type="name"></input>
                </div>
                <div className="profile__item">
                    <label className="profile__item-mail">E-mail</label>
                    <input className="input__mail" type="email"></input>
                </div>
            </form>
            <div className="profile__buttons">
                <button className="profile__button">Редактировать</button>
                <button className="profile__button">Выйти из аккаунта</button>
            </div>

        </section>
    );
}

export default Profile;
